import React from "react";
import styles from "./styles.module.css";

const Button = ({
  color = "blue",
  name = "name",
  onClick,
}) => {
  const onButtonClick = () => {
    if (onClick) {
      onClick(name);
    }
  };

  return (
    <div className="custom-button">
      {" "}
      <button
        className={`custom-button ${color}`}
        onClick={onButtonClick}
      >
        {name}
      </button>{" "}
    </div>
  );
};
export default Button;
